	BULK INSERT SWIFT_MB52
	FROM
		 @path + '' +WITH (
			FIRSTROW = 2,
			FIELDTERMINATOR = ',',
			ROWTERMINATOR = '\n'
		);
	*/
	set @sql = 'BULK INSERT SWIFT_MB52 FROM ''' + @path + ''' WITH (
										FIRSTROW = 2,
										FIELDTERMINATOR = '','',
										ROWTERMINATOR = ''\n''
									)'
	exec (@sql)


	--Check the content of the table.
	SELECT *
	FROM SWIFT_MB52;


